import Footer from "./components/layouts/footer/Footer";
import Header from "./components/layouts/header/Header"
import TodoList from "./components/TodoList/TodoList";

function App() {
  return (
    <div className="App">
      <Header/>
      <div class="content">
        <TodoList></TodoList>
      </div>
      <Footer/>
    </div>
  );
}

export default App;
